export default function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="wrapper border weather-app col">
          <div className="col-search">
            <Weather />
          </div>
          <CityTimeConditions />
          <Temperature />
          {/* <SunriseSunset /> */}
          <Forecast />
        </div>
    </div>
    <div className="footer">
        <Footer />
      </div>
    </div>
  );
}
